<!DOCTYPE html>
<html lang="">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no">
    <link rel="shortcut icon">
    <title>Gogs</title>
    <style>
    
    html {
        height: 100%;
        width: 100%;
        box-sizing: border-box;
        user-select: none;
        -ms-user-select: none;
    }

    *, *::before, *::after {
        box-sizing: inherit;
    } 
    
    body {
        background-color: #f5f5f5;
        height: 100%;
        font-family: Microsoft Yahei;
        padding: 0;
        margin: 0;
        flex-direction: column;
        align-items: center;
        display: flex;
    }
    
    header {
        box-shadow: 0 4px 6px rgba(100, 100, 100, .125);
        background-color: #fff;
        max-height: 56px;
        width: 100%;
        line-height: 56px;
        flex-grow: 1;
        z-index: 10;
        position: relative;
        display: flex;
        padding: 0 16px;
        /*align-items: center;*/
        /*line-height: 48px;*/
    }
    header > h1 {
        flex-grow: 2;
        font-size: 18px;
        font-weight: normal;
        margin: 0;
        color: #555;
    }
    header > a {
        text-decoration: none;
        color: #aaa;
        transition: transform .25s ease;
        transform: scale(1);
        width: 48px;
        height: 48px;
        text-align: center;
        right: 10px;
        position: absolute;
        cursor: default;
    }

    body.entry header > a.entry {
        transform: scale(0);
    }

    body.log header > a.log {
        transform: scale(0);
    }

    main {
        flex-grow: 2;
        width: 100%;
        position: relative;
        overflow: hidden;
    }
    
    .content {
        position: absolute;
        top: 0; right: 0; bottom: 0; left: 0;
    }
    
    .content.entry {
        display: flex;
        flex-direction: column;
        align-items: center;
        min-width: 96px;
        padding: 0 16px;
    }

    .content.log {
        background: #2a2a2a;
        transition: transform .25s ease, opacity .25s ease;
        transform: translateX(100%);
        opacity: 0;
        margin-right: -14px;
        overflow-x: hidden;
        overflow-y: auto;
    }

    .content.log pre {
        color: #a2a2a2;
        padding: 16px 8px;
        margin: 0;
        white-space: pre-wrap;
    }

    body.log .content.log {
        transform: translateX(0);
        opacity: 1
    }

    body.log footer.footer {
        /*display: none;*/
        height: 0;
    }

    img.cover {
        margin: 24px 0;
        max-width: 220px;
        height: auto;
    }

    button[type="button"] {
        width: 100%;
        transition: all .25s ease;
        border: 0;
        background-color: #ff5343;
        margin-top: 10px;
        padding: 16px 48px;
        font-size: 16px;
        border-radius: 2px;
        box-shadow: 0 2px 4px rgba(100, 100, 100, .25);
        outline: 0;
        color: #fff;
        position: relative;
    }
    button[disabled] {
        color: #aaa;
        background-color: #ddd;
        box-shadow: 0 1px 1px rgba(100, 100, 100, .35);
    }
    button[type="button"]::after {
        /*content: attr(tip);*/
        font-size: 12px;
        background-color: #222;
        padding: 6px;
        color: #666;
        position: absolute;
        border-radius: 6px;
        top: 110%;
        z-index: 6;
    }

    blockquote.comment {
        text-align: left;
        width: 100%;
        color: #aaa;
        font-size: 12px;
        background-color: #383838;
        flex-grow: 2;
        margin: 16px;
        /*margin-bottom: 0;*/
        padding: 8px;
    }
    blockquote.comment > code > samp {
        user-select: element;
        -ms-user-select: element;
    }
    blockquote.comment > code > samp::selection {
        background-color: #222;
    }

    .footer {
        /*flex-grow: 1;*/
        transition: height .25s ease;
        overflow: hidden;
        height: 32px;
        line-height: 32px;
        font-size: 12px;
        color: #777;
    }

    .comment > code + samp {
        animation: blink 1s infinite;
    }

    @keyframes blink {
        0% {
            opacity: 1;
        }
        10% {
            opacity: 0;
        }
    }
    
    </style>
</head>
<body class="entry">
    <header class="header">
        <h1>Gogs 控制面板</h1>
        <a id="goEntry" class="entry">返回</a>
        <a id="goLog" class="log">日志</a>
    </header>

    <main>
        <div class="content entry">
            <img class="cover"/>
            
            <button id="start" type="button" tip="启动程序">开始</button>
            <button id="restart" type="button">重启</button>
            <button id="stop" type="button">停止</button>
            
            <blockquote class="comment">
                终端<br>
                <code>c:\&gt;</code>
                <samp>|</samp>
            </blockquote>

        </div>

        <div class="content log">
            <pre id="log"></pre>
        </div>
    </main>

    <footer class="footer">
        <span>Powered By Gogs 2017</span>
    </footer>
